import React from 'react';
import { Card, Avatar, CardHeader } from '@material-ui/core';
import PersonIcon from "@material-ui/icons/Person";

export const CustomerCard = (props) => {
    console.log(props.item)
    return(
        <Card>
            <CardHeader
                avatar = {
                    <Avatar>
                        <PersonIcon color="primary" />
                    </Avatar>
                }
                title={props.name}
            />
        </Card>
    )
}
